import { useLocation,useNavigate } from "react-router-dom"
import React from "react"
import { useState } from "react"
export default  function Home (){
    const navigate = useNavigate()
    const location = useLocation()
    let [userstate,setstate] = useState({})
    React.useEffect(async()=>{
        if (localStorage.getItem("jsontoken"))
        {            
            const options ={
                method:'POST',
                header:{
                    'Content-Type':'application/json',
                },
                body:JSON.stringify({"jsontoken":localStorage.getItem("jsontoken")})
            }
            console.log(options.header)
           await fetch('http://127.0.0.1/verifyjwt',options).then(res=>res.json()).then(data=>{
                setstate(data)
            })
        }
        else
        navigate("/")
    },[])

    
    if (!location.state){
        userstate = setstate(location.state)
        localStorage.setItem("jsontoken",userstate.jsontoken)
        return <>
<h1>Your Userid for login is = {userstate.userid} Note on Paper</h1>
        
</>
    }
    
}
